import './server/server';
import Layout from './components/Layout';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './styles/App.css';

export default function App() {
  return (
    <BrowserRouter>
       <Routes>
          <Route element={ <Layout /> }>

          </Route>
       </Routes>
    </BrowserRouter>
  );
}
